DROP TABLE IF EXISTS `service_group_info`;
CREATE TABLE `service_group_info` (
  `group_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '组织ID',
  `address` varchar(100) DEFAULT NULL COMMENT '地址',
  `description` varchar(200) DEFAULT NULL COMMENT '描述',
  `group_name` varchar(40) NOT NULL COMMENT '名称',
  `id_level` varchar(40) NOT NULL COMMENT '辅助查询键',
  `tel_no` varchar(20) NOT NULL COMMENT '联系电话',
  `parent_id` int(11) NOT NULL COMMENT '父ID',
  `responsibility_people` varchar(50) NOT NULL COMMENT '负责人',
