  `counties` varchar(50) DEFAULT NULL COMMENT '区域编号',
  PRIMARY KEY (`group_id`)
) ENGINE=InnoDB AUTO_INCREMENT=136 DEFAULT CHARSET=utf8 COMMENT='系统组织结构库';

