-- ----------------------------
--  Table structure for `service_vehicle_info`
-- ----------------------------
DROP TABLE IF EXISTS `service_vehicle_info`;
CREATE TABLE `service_vehicle_info` (
  `vehicle_id` int(11) NOT NULL AUTO_INCREMENT,
  `vehicle_brand` varchar(20) DEFAULT NULL COMMENT '品牌',
  `vehicle_license` varchar(50) DEFAULT NULL COMMENT '车牌号',
  `vehicle_state` smallint(6) DEFAULT NULL COMMENT '车辆状态',
  `group_id` int(11) DEFAULT NULL,
  `vehicle_buy_date` date DEFAULT NULL,
  `vehicle_type` smallint(6) DEFAULT NULL COMMENT '车辆类别',
  `vehicle_explain` varchar(255) DEFAULT NULL COMMENT '车辆说明',
  `vehicle_buy_price` decimal(10,0) DEFAULT NULL COMMENT '车辆购买价格',
  `vehicle_model` varchar(255) DEFAULT NULL COMMENT '车辆型号',
  `vehicle_driver` varchar(255) DEFAULT NULL COMMENT '车辆驾驶员',
  `vehicle_place` varchar(255) DEFAULT NULL COMMENT '车辆停放位置',
  `vehicle_photo` varchar(255) DEFAULT NULL COMMENT '车辆图片',
  `vehicle_from` smallint(6) DEFAULT NULL COMMENT '来源平台',
  `device_name` varchar(100) DEFAULT NULL COMMENT '设备名称',
  PRIMARY KEY (`vehicle_id`),
  UNIQUE KEY `device_name` (`device_name`) USING BTREE,
  KEY `vehiclegroupid` (`group_id`) USING HASH,
  CONSTRAINT `fk_group_id_vehicle` FOREIGN KEY (`group_id`) REFERENCES `service_group_info` (`group_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=548 DEFAULT CHARSET=utf8 COMMENT='系统车辆管理信息库';

