-- ----------------------------
--  Table structure for `service_vehicle_insurance_info`
-- ----------------------------
DROP TABLE IF EXISTS `service_vehicle_insurance_info`;
CREATE TABLE `service_vehicle_insurance_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `insurance_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '保险公司名称',
  `insurance_type` int(11) DEFAULT NULL COMMENT '保险类型',
  `policy_number` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '保单号',
  `insurance_start_date` datetime DEFAULT NULL COMMENT '保险开始时间',
  `insurance_end_date` datetime DEFAULT NULL COMMENT '保险结束时间',
  `insurance_amount` int(11) DEFAULT NULL COMMENT '投保金额',
  `vehicle_id` int(11) DEFAULT NULL COMMENT '车辆ID',
  `insurance_remark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '保险备注',
  PRIMARY KEY (`id`),
  KEY `fk_vehicle_insurance_id` (`vehicle_id`),
  CONSTRAINT `fk_vehicle_insurance_id` FOREIGN KEY (`vehicle_id`) REFERENCES `service_vehicle_info` (`vehicle_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='车辆保险信息管理库';

