-- ----------------------------
--  Table structure for `service_vehicle_maintenance_info`
-- ----------------------------
DROP TABLE IF EXISTS `service_vehicle_maintenance_info`;
CREATE TABLE `service_vehicle_maintenance_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `vehicle_id` int(11) NOT NULL COMMENT '车辆ID',
  `maintenance_time` datetime NOT NULL COMMENT '保养时间',
  `maintenance_reason` varchar(255) DEFAULT NULL COMMENT '保养原因',
  `maintenance_identify_state` smallint(6) DEFAULT NULL COMMENT '保养类型',
  `maintenance_cost` decimal(10,0) NOT NULL COMMENT '保养费用',
  `maintenance_state` smallint(6) DEFAULT NULL COMMENT '保养状态',
  `maintenance_remark` text COMMENT '备注',
  PRIMARY KEY (`id`),
  KEY `vehicle_id` (`vehicle_id`),
  CONSTRAINT `fk_vehicle_maintenance_id` FOREIGN KEY (`vehicle_id`) REFERENCES `service_vehicle_info` (`vehicle_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=716 DEFAULT CHARSET=utf8 COMMENT='车辆保养信息管理库';

