-- ----------------------------
--  Table structure for `service_vehicle_record`
-- ----------------------------
DROP TABLE IF EXISTS `service_vehicle_record`;
CREATE TABLE `service_vehicle_record` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `car_license` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '车牌号码',
  `start_date` datetime DEFAULT NULL COMMENT '出车时间 ',
  `end_date` datetime DEFAULT NULL COMMENT '回车时间',
  `driver_name` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '司机姓名',
  `apply_date` datetime DEFAULT NULL COMMENT '申请时间 ',
  `apply_man` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '申请人 ',
  `destination` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '目的地',
  `type` int(11) DEFAULT '0' COMMENT '0=手动添加 1=来自同步',
  `remark` text COLLATE utf8_bin COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_vehicle_record` (`car_license`,`start_date`,`end_date`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1428 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='车辆出车记录库';

