-- ----------------------------
--  Table structure for `service_vehicle_repair_info`
-- ----------------------------
DROP TABLE IF EXISTS `service_vehicle_repair_info`;
CREATE TABLE `service_vehicle_repair_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `damage_time` datetime DEFAULT NULL COMMENT '损坏时间',
  `repair_reason` varchar(255) DEFAULT NULL COMMENT '维修原因',
  `repair_identify_state` smallint(6) DEFAULT NULL COMMENT '损坏程度',
  `repair_cost` decimal(10,0) DEFAULT NULL COMMENT '维修费用',
  `repair_state` smallint(6) DEFAULT NULL COMMENT '维修情况',
  `vehicle_id` int(11) DEFAULT NULL COMMENT '车辆ID',
  `repair_remark` text COMMENT '维修备注',
  PRIMARY KEY (`id`),
  KEY `vehicle_id` (`vehicle_id`),
  CONSTRAINT `fk_vehicle_repair_id` FOREIGN KEY (`vehicle_id`) REFERENCES `service_vehicle_info` (`vehicle_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1391 DEFAULT CHARSET=utf8 COMMENT='车辆维修记录管理库';

