-- ----------------------------
--  Table structure for `service_vehicle_violation_info`
-- ----------------------------
DROP TABLE IF EXISTS `service_vehicle_violation_info`;
CREATE TABLE `service_vehicle_violation_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `violation_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '规费名称',
  `violation_points` int(11) DEFAULT NULL COMMENT '扣分 ',
  `violation_location` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '规费位置',
  `violation_cost` float DEFAULT NULL COMMENT '缴纳费用',
  `violation_time` datetime DEFAULT NULL COMMENT '规费时间',
  `vehicle_id` int(11) DEFAULT NULL COMMENT '车辆ID',
  `violation_remark` text COLLATE utf8_bin COMMENT '规费备注',
  PRIMARY KEY (`id`),
  KEY `fk_vehicle_violation_id` (`vehicle_id`),
  CONSTRAINT `fk_vehicle_violation_id` FOREIGN KEY (`vehicle_id`) REFERENCES `service_vehicle_info` (`vehicle_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=419 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='车辆规费信息管理库';

